message: |-
  فيه تشبيه قرأته من فترة عن الفروق بين الأفراد في مجال الـ software development وبصراحة اظنه الأصح والأقرب وملوش أي علاقة بالصناعة بتاعتنا.

  انت ممكن تجيب واحد وتقوله بص ... دي بحيرة ودي اسمها سنارة. تشرحله أجزاء السنارة. بتنزل السنارة في المية (وتوريله) وتمسكها شوية وتنتظر لغاية ما الخيط يتحرك. أول ما تحس بشد اسحب على طول ... ده المبتدئ أو زي ما بنقول (junior).

  واحد تاني تقوله بص خد السنارة روح البحيرة اصطادلنا سمك وده المتوسط أو الـ (mid-level)

  فيه واحد تاني انت كل اللي بتقوله له "احنا عايزين ناكل". الراجل ده يروح بقى يصطاد من الأرض أو البحر أو يزرع أو يشتري ... ده بقى الأدرى بالحل مش منتظر توجيه وهو ده الـ (senior)
