  - created_time: '2018-03-17T17:04:46+0000'
    from:
      name: Mohamed Bassem
      id: '10212826240185281'
    message: |-
      It’s very similar to the expectations of the engineering levels abroad. The junior (E3) is expected to work on the task level. Someone has already broken down the project into smaller tasks for them. They should show some level of independence and have the ability to unblock themselves.
      The mid-level (E4) works on mid sized projects with a well defined problem statement and probably a straightforward solution.
      The senior (E5) is the one who searches for new problems for the team to explore. They help in setting up the team’s direction along with the mentoring responsibilities.
    id: '1786538461385854'
